import React from 'react';
import { ReverseButton } from '../../components/ReverseButton';
import {data} from './_mock_'
import './style.css'

export const Main = () => {
    return (
        <div className='wrapper' >
            {data.map((item)=>{
                return <ReverseButton {...item}/>
            })}
        </div>
    );
};
